import React from "react";

export default function () {
  return (
    <div className="profession">
    <hr></hr>
      <h3>Professional Experience</h3>
      <h4>HighRadius | Product Engineer Intern</h4>
      <p>
        Developed a Machine Learning model using data analysis and predictive
        modeling techniques to predict customer order amounts, integrated with a
        Full-stack Invoice Management Application built with React JS, Java
        Servlets, and JDBC for web development and database management.
      </p>

      <style>
        {`
             .profession{
                background-color: #f0f0f0;
                padding: 10px;
             }

             .profession hr{
                border-width: 2px;
                font-weight: bold;
             }

            .profession h3 {
            text-align: left;
            margin-left: 6px;
            font-size: 25px;
            font-family: 'Times New Roman', Times, serif;
            color: #333;
          }

          .profession h4 {
            text-align: left;
            margin-left: 10px;
            font-size: 20px;
            font-family: 'Times New Roman', Times, serif;
            color: #555;
          }

          .profession p{
            text-align: left;
            inline-height:1.5;
            font-size:18px;
            margin-left: 20px;
            margin-right: 20px;
          }
            
            `}
      </style>
    </div>
  );
}
